  return (
    <div>
      <button>
        <Link to="/Breakfast">Breakfast</Link>
      </button>
      <button>
        <Link to="/Lunch"> Lunch</Link>
      </button>
      <button>
        <Link to="/Dinner">Dinner</Link>
      </button>
    </div>
  );
}

export default Home;
